
--------------------------------------------------------
--  DDL for Table RECEIPT_DETAIL
--------------------------------------------------------
DECLARE NB NUMBER;
BEGIN
  SELECT count(*) INTO NB FROM user_tables WHERE TABLE_NAME = 'receipt_detail';
  IF 
    NB = 0
  THEN
    EXECUTE IMMEDIATE 'create table receipt_detail ( receipt_detail_id varchar(20),
                                              drop_id number REFERENCES dropid (drop_id),
                                              item_id number REFERENCES item (item_id),
                                              receipt_id number REFERENCES receipt (receipt_id)
                                                )';
 END IF;
 END;
